import React, {useState} from 'react';
import {UserContext} from "../../context/UserContext";

function HeaderLogo() {

    const userLoggedIn = useState(UserContext);

    return (
        <div>
            {userLoggedIn ? <p>Logo User name</p> : <p>Logo Brand</p>}
        </div>
    );
}

export default HeaderLogo;
